import axios from 'axios';
import { useState } from "react"; 

function StudentRegForm(){
  const [firstName, setFirstName] = useState("");
  const [middleName, setMiddleName] = useState("");
  const [lastName, setLastName] = useState("");
  const [dob, setDOB] = useState("");
  const [fatherName, setFatherName] = useState("");
  const [motherName, setMotherName] = useState("");
  const [state1, setState1] = useState("");
  const [city, setCity] = useState("");
  const [gender, setGender] = useState("");
  const [categorytype, setCategorytype] = useState("");
  const [contact, setContact] = useState("");
  const [religion, setReligion] = useState("");
  const [uid, setUid] = useState("");
  const [address, setAddress] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [country, setCountry] = useState("");
  const [zipcode, setZipcode] = useState("");

  // const [emps,setEmps] =  useState([]);
  //   const [emp,setEmp] =  
  //           useState({uid: 0, firstName : "", middleName: ""});

  const studentData = {
    uid:uid,
        firstName:firstName,
        middleName:middleName,
        lastName:lastName,
        fatherName:fatherName,
        motherName:motherName,
        email:email,
        password:password,
        gender:gender,
        categorytype:categorytype,
        religion:religion,
        address:address,
        city:city,
        state:state1,
        country:country,
        zipcode:zipcode,
        dob:dob,
        contact:contact   
  }

  const save = async(event)=>{
    event.preventDefault();
    try {
        await fetch("http://192.168.144.185:8080/student",{
          method : 'POST',
          headers:{
            'Content-Type' : 'application/json'
          },

    });
    alert("Student registration sccessful")

    } catch (error) {
      alert("Student registration failed")
    }
  }

  const insert=()=>
    {
        // this.state.empToBeAdded .. hold record's data
        // to be send to Node Server!
        var helper = new XMLHttpRequest();
        helper.onreadystatechange = ()=>{
            if(helper.readyState == 4 &&
                helper.status == 200)
                {
                    var responseReceived = 
                        JSON.parse(helper.responseText);
                    if(responseReceived.affectedRows!=undefined && responseReceived.affectedRows>0)
                    {
                        setMessage("Insert Successfull!")
                        select();
                        setEmp({ENo: 0, 
                                         EName : "", EAddress: ""});
                    }
                    else
                    {
                        setMessage("Something went wrong!")
                    }
                }
        };
        helper.open("POST","http://192.168.144.185:8080/student");
        helper.setRequestHeader("Content-Type", "application/json")
        helper.send(JSON.stringify(emp));   


    }

    return(


        <div className="container" >
            <div className="py-5 text-center">

              <h2>Student Registration form</h2>
              <p className="lead"></p>
            </div>

            <div className="row">

              <div className="col-md-12 order-md-3">
                <h4 className="mb-3"></h4>

                  <div className="row">
                    <div className="col-md-4 mb-3">
                      <label for="firstName">First name*</label>
                      <input type="text" className="form-control" id="firstName" placeholder="" value={firstName}
                      onChange={(event)=>{
                        setFirstName(event.target.value);
                      }}
                      required/>

                      {/* <div className="invalid-feedback">
                        Valid first name is required.
                      </div> */}
                    </div>
                      <div className="col-md-4 mb-3">
                        <label for="firstName">Middle name*</label>
                        <input type="text" className="form-control" id="middleName" placeholder="" value={middleName}
                      onChange={(event)=>{
                        setMiddleName(event.target.value);
                      }} required/>
                        {/* <div className="invalid-feedback">
                          Valid first name is required.
                        </div> */}
                    </div>
                    <div className="col-md-4 mb-3">
                      <label for="lastName">Last name*</label>
                      <input type="text" className="form-control" id="lastName" placeholder="" value={lastName}
          onChange={(event) => setLastName(event.target.value)}required/>
                      {/* <div className="invalid-feedback">
                        Valid last name is required.
                      </div> */}
                    </div>
                  </div>

                  <div Style="align-content: center;">
                    <form className="needs-validation" novalidate>
                      <div className="row">
                        <div className="col-md-3 mb-3">
                          <label for="dateofbirth">Date of Birth*</label>
                          <input type="date" className="form-control" id="dob" placeholder=""  value={dob}
          onChange={(event) => setDOB(event.target.value)} required/>
                        </div>
                        <div className="col-md-3 mb-3">
                            <label for="Blood Group">Age</label>
                            <input type="number" className="form-control" id="age" placeholder=""  readonly/>
                            {/* <div className="invalid-feedback">
                              Valid name is required.
                            </div> */}
                    </div>

                    <div className="col-md-3 mb-3">
                            <label for="Gender">Gender</label>
                      <select className="custom-select d-block w-75" id="gender" value={gender}
          onChange={(event) => setGender(event.target.value)} required>
                        <option value="">Choose...</option>
                        <option>Male</option>
                        <option>Female</option>
                        <option>Other</option>
                      </select>
                      {/* <div className="invalid-feedback">
                        Please select a valid Gender.
                      </div>     */}
                        </div>
                        {/* <div className="col-md-3 mb-3"> */}
                            {/* <label for="Blood Group">Blood Group</label> */}
                            {/* <input type="text" className="form-control" id="bloodgroup" placeholder="" /> */}
                            {/* <div className="invalid-feedback">
                              Valid name is required.
                            </div> */}
                    {/* </div> */}
                    </div>
                    </form>
                </div>
                </div>   



                  <div Style="align-content: center;">
                    <form className="needs-validation" novalidate>
                      <div className="row">
                        <div className="col-md-6 mb-3">
                          <label for="firstName">Father's Name*</label>
                          <input type="text" className="form-control" id="fatherName" placeholder=""  value={fatherName}
          onChange={(event) => setFatherName(event.target.value)} required/>
                          {/* <div className="invalid-feedback">
                            Valid name is required.
                          </div> */}
                        </div>
                          <div className="col-md-6 mb-3">
                            <label for="firstName">Mother's Name*</label>
                            <input type="text" className="form-control" id="motherName" placeholder=""  value={motherName}
          onChange={(event) => setMotherName(event.target.value)} required/>
                            {/* <div className="invalid-feedback">
                              Valid name is required.
                            </div> */}
                        </div>
                    </div>
                    </form>
                </div>






                  <div className="row">
                    <div className="col-md-4 mb-3">
                      <label for="country">Country*</label>
                      <select className="custom-select d-block w-100" id="country" value={country}
          onChange={(event) => setCountry(event.target.value)}required>
                        <option value="">Choose...</option>
                        <option>India</option>
                      </select>
                      {/* <div className="invalid-feedback">
                        Please select a valid country.
                      </div> */}
                    </div>
                    <div className="col-md-4 mb-3">
                      <label for="state1">State*</label>
                      <select className="custom-select d-block w-100" id="state1" value={state1}
          onChange={(event) => setState1(event.target.value)}required>
                        <option value="">Choose...</option>
                        <option>Maharashtra</option>
                        <option>Madhya Pradesh</option>
                        <option>Delhi</option>
                      </select>
                      {/* <div className="invalid-feedback">
                        Please provide a valid state.
                      </div> */}
                    </div>
                    <div className="col-md-4 mb-3">
                        <label for="city">City*</label>
                        <input type="text" className="form-control" id="city" placeholder="" value={city}
          onChange={(event) => setCity(event.target.value)}required/>
                        {/* <div className="invalid-feedback">
                          Please provide a valid district.
                        </div> */}
                      </div>

                  </div>
                  <div className="mb-3">
                    <label for="address">Permanent Address*</label>
                    <input type="text" className="form-control" id="address" placeholder="" value={address}
          onChange={(event) => setAddress(event.target.value)}required/>
                    {/* <div className="invalid-feedback">
                      Please enter your valid Permanent address.
                    </div> */}
                  </div>

                  <div className="mb-3">
                    <label for="address2">Correspondance Address*<span className="text-muted"></span></label>
                    <input type="text" className="form-control" id="address2" placeholder="" required/>
                  </div>
                  <div className="mb-3">
                    <label for="zipcode">Zip-Code*<span className="text-muted"></span></label>
                    <input type="text" className="form-control" id="zipcode" placeholder="" value={zipcode}
          onChange={(event) => setZipcode(event.target.value)}required/>
                  </div>



                  <div className="row">
                    <div className="col-md-9 mb-3">
                        <label for="email">Email*<span className="text-muted"></span></label>
                        <input type="email" className="form-control" id="email" placeholder="you@example.com" value={email}
          onChange={(event) => setEmail(event.target.value)}/>
                        {/* <div className="invalid-feedback">
                          Please enter a valid email.
                        </div> */}
                    </div>
                    <div className="col-md-3 mb-3">
                          <label for="password">Password*</label>
                          <input type="text" className="form-control" id="password" placeholder="" value={password}
          onChange={(event) => setPassword(event.target.value)}required/>
                          {/* <div className="invalid-feedback">
                            Contact number is required.
                          </div> */}
                        </div>
                        <div className="col-md-3 mb-3">
                          <label for="Contact">Contact*</label>
                          <input type="text" className="form-control" id="contact" placeholder="" value={contact}
          onChange={(event) => setContact(event.target.value)}required/>
                          {/* <div className="invalid-feedback">
                            Contact number is required.
                          </div> */}
                        </div>
                  </div>

                  </div>


                  <div className="row">
                    <div className="col-md-4 mb-3">
                      <label for="country">Religion*</label>
                      <select className="custom-select d-block w-100" id="religion" value={religion}
          onChange={(event) => setReligion(event.target.value)}required>
                        <option value="">Choose...</option>
                        <option>Hindu</option>
                        <option>Muslim</option>
                        <option>Chritian</option>
                        <option>Sikh</option>
                        <option>Other Minorities</option>
                      </select>
                      {/* <div className="invalid-feedback">
                        Please select a valid religion.
                      </div> */}
                    </div>
                    <div className="col-md-4 mb-3">
                      <label for="state">Category*</label>
                      <select className="custom-select d-block w-100" id="category" value={categorytype}
          onChange={(event) => setCategorytype(event.target.value)}required>
                        <option value="">Choose...</option>
                        <option>General</option>
                        <option>OBC</option>
                        <option>SC</option>
                        <option>ST</option>
                      </select>
                      {/* <div className="invalid-feedback">
                        Please provide a valid state.
                      </div> */}
                    </div>
                    {/* <div className="col-md-4 mb-3">
                        <label for="state">Mother tounge*</label>
                        <select className="custom-select d-block w-100" id="mothertounge" required>
                          <option value="">Choose...</option>
                          <option>Hindi</option>
                          <option>Mararthi</option>
                          <option>Gujrati</option>
                          <option>Punjabi</option>
                        </select>
                        <div className="invalid-feedback">
                          Please provide a valid district.
                        </div>
                      </div> */}
                  </div>


                  <hr className="mb-4"/>

                  <hr className="mb-4"/>



                  <div className="d-block my-3">


                  </div>

                  <div className="row">
                     <center> 
                        <label for="registrationdate">Aadhar Card*</label>
                          <input type="number" className="" id="aadharcard" placeholder=""  value={uid}
          onChange={(event) => setUid(event.target.value)}required/>
                          &nbsp;
                        {/* <label for="registrationdate">Date of Registration*</label>
                          <input type="date" className="" id="dateofregistration" placeholder="" value={dateOfRegistration}
          onChange={(e) => setdateOfRegistration(e.target.value)}required/> */}
                     </center> 
                </div>


                    <hr className="mb-4"/>
                    <div className="row" Style="justify-content: center;">
                        <div className="col-md-4 mb-3">
                            <button className="btn btn-primary btn-lg btn-block" Style="align-content: center;" type="submit" onClick={save}>Continue to checkout</button>
                        </div>
                    </div>

                    <div>
                  </div>

              </div>

    );
}

export default StudentRegForm;
